<script setup>
import {useStore} from "vuex";
import {computed, ref, onMounted, onUnmounted} from 'vue'
import {useRoute} from "vue-router";
import {RouterLink} from "vue-router";
import Logo from "@/components/common/Logo.vue";
import Button from "@/components/buttons/Button.vue";

const route = useRoute();
const headerClasses = ref('fixed z-[99] w-full top-0 left-0 bg-transparent transition-colors duration-300 bg-transparent');
const store = useStore()
const headerMenu = computed(() => store.state.headerMenu)

const handleScroll = () => {
  if (window.scrollY > 10) {
    headerClasses.value = 'fixed w-full top-0 z-[99] left-0 bg-white shadow-[0_8px_12px_rgba(22,28,39,.04)] transition-colors duration-500';
  } else {
    headerClasses.value = 'fixed w-full top-0 z-[99] left-0 bg-transparent transition-colors duration-300';
  }
};

onMounted(() => {
  window.addEventListener('scroll', handleScroll);
});

onUnmounted(() => {
  window.removeEventListener('scroll', handleScroll);
});
</script>
